total_superstars = 2050

tt = TokenType.find_by_name("Shambala Star")

if tt.nil?
  if Rails.env === "development"
    tt = TokenType.create! name: "Shambala Star", festival_id: 52, organisation_id: 1, contract_address: "0xa0Fd9B3E763D57E9269816DA53e17d837B7Bec7b", image_base64: "data:image/jpeg;base64,"
  else
    tt = TokenType.create! name: "Shambala Star", festival_id: 52, organisation_id: 1, contract_address: "0xE42862e1e124DBE283b9FfD9083aeE1473036016", image_base64: "data:image/jpeg;base64,"
  end
end

superstar_nonces = []

(0...total_superstars).each do |index|
  token = Token.create! token_type_id: tt.id, festival_id: 52
  superstar_nonces << token.nonce
end

puts superstar_nonces